package org.springframework.samples.petclinic.model;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
import static org.junit.jupiter.api.Assertions.assertEquals;
import org.junit.jupiter.api.Test;

class BaseEntityTest {

	private BaseEntity instance;

	@BeforeEach
	void setUp() {
		instance = new BaseEntity();
	}

	@Test
	@DisplayName("Verifies that getId returns the id value when set to a valid integer")
	void testGetIdReturnsSetId() {
		instance.setId(42);
		var result = instance.getId();
		assertEquals(42, result);
	}

	@Test
	@DisplayName("Verifies that getId returns null when id is set to null")
	void testGetIdReturnsNullWhenIdIsNull() {
		instance.setId(null);
		var result = instance.getId();
		assertNull(result);
	}

	@Test
	@DisplayName("Verifies that getId returns negative integer values correctly")
	void testGetIdReturnsNegativeId() {
		instance.setId(-1);
		var result = instance.getId();
		assertEquals(-1, result);
	}

	@Test
	@DisplayName("Sets the id with a valid positive integer")
	void testSetIdWithValidId() {
		instance.setId(1);
	}

	@Test
	@DisplayName("Sets the id with null value")
	void testSetIdWithNull() {
		instance.setId(null);
	}

	@Test
	@DisplayName("Sets the id with zero as the value")
	void testSetIdWithZero() {
		instance.setId(0);
	}

	@Test
	@DisplayName("Sets the id with a negative integer")
	void testSetIdWithNegative() {
		instance.setId(-1);
	}

}
